import React from 'react'

function SellerCard( {seller} ) {

    const tempCardStyle = {
        margin: '5px',
        textAlign: 'center',
        padding: '5px',
        float: 'left',
        overflow: 'hidden',
    }

    const tempImgStyle = {
        overflow: 'hidden',
        objectFit: 'cover',
        height: '140px',
        width: '140px',
        borderRadius: '50%',
    }

    let imgSrcLink;

    if (seller.image !== null) {
        imgSrcLink = seller.image.medium
        }
    else {
        imgSrcLink = "https://www.wolflair.com/wp-content/uploads/2017/01/placeholder.jpg";
        }

    return (
        <div className="ui card" style={tempCardStyle}> 
            <img src={imgSrcLink} className="ui small centered image" alt={seller.name} style={tempImgStyle}/>
            <h3 className="ui header">{seller.name}</h3>
            <p className="ui meta">See {seller.name.split(' ', 1)}'s products here</p>
        </div>
    )
}

export default SellerCard
